function _api_DownFile(_url, callback) {
	api.download({
		url: _url,
		report: true,
		cache: true,
		allowResume: true
	}, function(ret, err) {
		if(ret.state == 1) {
			//下载成功  ret.savePath
			callback(ret.savePath);
		}
	});
}

