//获取字符串中的淘口令和链接

function dpstr(_str) {
	var _rstr = _str;
	if(_str.indexOf('http') > -1) {
		var rg = /(http[s]?:\/\/([\w-]+.)+([:\d+])?(\/[\w-\.\/\?%&=]*))/g;
		_rstr = _str.match(rg);
	}
	if(_str.indexOf('￥') > -1) {
		var _arr = _str.split('￥');
		var _rg = /^[A-Za-z0-9]{11}$/;
		$.each(_arr, function(key, val) {
			if(val.length == 11 && _rg.test(val)) {
				_rstr = '￥' + val + '￥';
			}
		});
	}
	return _rstr;
}
